import logo from "./logo.svg";
import "./App.css";
import RegistrationForm from "./component/RegistrationForm";
import Order from "./component/Order";
import ErrorBoundary from "./component/ErrorBoundary";

function App() {
  return (
    <div className="App">
      <ErrorBoundary>
        <RegistrationForm />
      </ErrorBoundary>
      <Order />
    </div>
  );
}

export default App;
